import ExpenseItem from './ExpenseItem';

function Expenses (props) {
    return (
    <div className='expenses'>
         {props.map(() => {
        return <ExpenseItem 
                title={items.title}
                amount={items.amount}
                date={items.date}
              />
      })}   
    </div>
    );
}

